import './App.css';
import Default from '../Default';
import Title from '../../components/Title';

import photo from '../../assets/img/myphoto.png';

import data from "../../data.json";

const name = data.map((data) => {
  return data.name;
})

function App() {
  return (
    <div className="App">
       <Default />
       <Title photo={photo}/>

    </div>
  );
}

export default App;
